<div class="text">
<p><span style="background-color: #ff6600; color: #ffffff;"><strong>About Us</strong></span></p>
<p>Asian&nbsp;Links is a leading two-way trading company in the world, which has won the trust of a large number of brand owners and importers with its unique service.</p>
<p>Our Asian&nbsp;office develops close relationships with suppliers and manages merchandizing to satisfy final customers with a focus on price, quality and design.&nbsp;We are committed to offer each of our suppliers and retailers worldwide, innovative products that are of the highest standards at a reasonable price.</p>
<ul>
<li><span></span>We innovate</li>
</ul>
<p>To turn your ideas into successful products.</p>
<p>Based in France&nbsp;and England, our engineers are working with our marketing department to develop innovative products which respond and pre-empt our customer&rsquo;s needs.</p>
<ul>
<li><span></span>Closer to the sources</li>
</ul>
<p>We find, evaluate and engage the best suppliers to provide products and services.</p>
<p>We create partnerships to insure that the products that we develop are made with the best practices.</p>
<p>Even if our main sources are in Asia, we are also working with North African, European and</p>
<p>South American sources and providing products from more than 20 countries.</p>
<p>&nbsp;</p>
<p>There are many challenges when starting something new. This applies when trying to source products from China. The challenges can include, identifying the most suitable manufacturer, dealing directly with the manufacturer, establishing a direct communication channel to China, trying to maintain, control and meet deadlines, achieving the best value, establishing the most efficient logistics solution and installing a instant problem solving system should any be identified.</p>
<p>We are a Client-Oriented Service Provider, and we understand that sourcing job needs specialists who can feedback clients&rsquo; need quickly and do their work effectively. Therefore, our assigned personnel will communicate with you consistently and to implement sourcing works to keep in tune with your objectives.</p>
<p>&nbsp;</p>
<p></p>
<p><span style="background-color: #ff6600; color: #ffffff;">Sourcing standard procedure as below:</span></p>
<ul>
<li>Get sample / prototype / photo / draft / idea from Client</li>
<li>Client demands and culture study</li>
<li>Sample / prototype / photo / draft / idea reviewed by our sourcing team</li>
<li>Assign a team leader to shoulder up the responsibility in sourcing</li>
<li>The team leader contact at least 3 manufacturers and communicate with them and get quotations, lead time and initial samples.</li>
<li>Make comparison of the initial quotation, trade terms and samples&rsquo; quality, and then recommend 2-3 best candidates for client.</li>
<li>If denied by client, re-sourcing of new manufacturers.</li>
</ul>
<p>&nbsp;</p>
<p></p>
<p><span style="background-color: #ff6600; color: #ffffff;"><strong>WHY CHOOSE US</strong></span></p>
<p>QUALITY: The quality of our products is backed by our vast experience and skills. Besides, the vertically integrated nature of our operations enables us to offer ex-stock delivery of goods at extremely competitive prices.</p>
<p>SERVICE: We carefully listen to each client''s unique needs. We maintain close personal interaction with each of our clients, providing necessary support in various areas including product mix determination, presentation and point of sale promotions.</p>
<p>PROFITS: All goods bought from our wholesale stock can be resold at a huge profit so that our customers can compete favorably with high street stores, therefore increasing their profit margins substantially.</p>
<p>SUBSTITUTABILITY: We have built our reputation as a successful middle market buyout firm by partnering with high-quality niche players, preparing them for the next level of growth and providing the support they need to achieve it; We take into consideration the needs and wants of an ever changing market place and fine-tune our product mix accordingly.</p>
<p>INNOVATION: Simultaneously, the valuable feedback received from our satisfied customers facilitates continuous product improvement at our end, enabling us to offer a choice of unique products and designs.</p>
<p>ORDERING SYSTEM: We have a quick and efficient ordering system.</p>
</div>
