<div class="text">
<h2>CSP means Credible Supplier Program</h2>
<p>CSP&rsquo;&nbsp;vision&nbsp;is reduce audit fatigue, avoid duplication and reduce the number of social &amp; labor audits by current proprietary assessment tools</p>
<p>&nbsp;</p>
<h2>CSP accept the most three audit contents:</h2>
<p>Corporation Social Responsibility, we accept the following&nbsp;audit programs:</p>
<ul>
<li><span></span>SAS-Social Accountability &amp; Sustainability</li>
<li><span></span>SMETA-SEDEX Members Ethical Trade Audit</li>
<li><span></span>BSCI-Business Social Compliance Initiative</li>
</ul>
<p>Supply chain security audit, we accept the following audit programs:</p>
<ul>
<li><span></span>FSA-Factory Security Assessment</li>
<li><span></span>SCAN-Supplier Compliance Audit Network</li>
<li><span></span>C-TPAT-Customs Trade Partnership Against Terrorism</li>
<li><span></span>GSV-Global Security Verification</li>
</ul>
<p>Quality technical audit, we accept the following audit programs:</p>
<ul>
<li><span></span>SQE-Supplier Quality Evaluation</li>
<li><span></span>SQP-Supplier Qualification Program</li>
<li><span></span>GMP-Good Manufacturing Practices</li>
</ul>
<p>Customers with special requirements can participate in the audit category according to their own needs, just like Brand Protection&nbsp;Audit, Environmental Compliance, Mold Prevention Assessment, Bribery Management Systems, and so on.</p>
<p>&nbsp;</p>
<h2>Assessment Process and Ratings</h2>
<p>Asian Links&nbsp;reviews third-party audit reports suppliers submit for the facility and assigns the facility a color rating based on the third-party program&rsquo;s evaluation of the facility and Asian Links&rsquo; own review of the report. The most common facility ratings are:</p>
<ul>
<li>Green: Green ratings identify facilities whose audits indicate a high level of compliance with the Standards.</li>
<li>Yellow: Yellow ratings identify facilities whose audits indicate general compliance with the Standards.</li>
<li>Orange: Orange ratings identify facilities whose audits indicate more serious violations of the Standards, but from which Asian Links will continue to allow sourcing while the violations are remediated. Three consecutive Orange ratings may result in a Red rating, regardless of whether the facility remains in good standing with the audit program chosen. Additionally, suppliers who submit an audit report that results in an Orange rating must continue to use the same audit program until the facility improves its rating to Green or Yellow.</li>
<li>Red: Red ratings identify facilities for which Responsible Sourcing has discovered violations of a nature that may make it appropriate to temporarily or permanently terminate the facility&rsquo;s ability to produce product for Asian Links. Red ratings may also be used to identify facilities whose third-party program seal or certification has been revoked, and for facilities that may have been terminated by a third-party audit program. If a facility is assessed a Red rating, its ability to produce product for Asian Links may be ended indefinitely, its production halted and/or its product refused. Each audit report submitted will correspond with an initial &ldquo;base&rdquo; color rating for the facility, which is based on the audit rating generated by and/or findings made by the audit program. Certain audit program ratings will correspond with Asian Links colors&mdash;Green, Yellow, Orange, or Red. Asian Links assessors will then review the report&rsquo;s findings to look for higher-risk issues that may change the facility&rsquo;s color rating to Orange or Red and that may be escalated for possible investigation or supplier engagement. Where such higher-risk issues are identified, the final facility rating may be Orange or Red even if the &ldquo;base&rdquo; color rating for the facility derived from the audit program&rsquo;s evaluation of the facility was Green or Yellow. The facility ratings are provided to all suppliers using the facility.</li>
</ul>
</div>
</div>');
